import logo from './logo.svg';
import './App.css';
import TextBox from './TextBox'
import React, {useState} from 'react'
import { AwesomeButton } from "react-awesome-button";
import "react-awesome-button/dist/styles.css";

function Route() {
  function handleStartLat(e) {
    console.log(e.target.value)
    setStartLat(e.target.value)
  }
  function handleStartLon(e) {
    setStartLat(e.target.value)
  }
  function handleEndLat(e) {
    setStartLat(e.target.value)
  }
  function handleEndLon(e) {
    setStartLat(e.target.value)
  }
  const [startLat, setStartLat] = useState(0);
  const [startLon, setStartLon] = useState(0);
  const [endLat, setEndLat] = useState(0);
  const [endLon, setEndLon] = useState(0);
  return (
    <div className="Route">
      <header className="Route-header">
        <title>This is a title</title>
      </header>
      <h1>{startLat}</h1>
        <TextBox label={"Start Latitude"} onChange = {(e) => handleStartLat(e)}/>
        <TextBox label={"Start Longitude"} onChange = {(e) => handleStartLon(e)}/>
        <TextBox label={"End Latitude"} onChange = {(e) => handleEndLat(e)}/>
        <TextBox label={"End Longitude"} onChange = {(e) => handleEndLon(e)}/>
      <AwesomeButton type="primary">Button</AwesomeButton>
    </div>
  );
}
export default Route;
